                                {
                                    uc_Main uc = (uc_Main)tc_Main.Controls[tc_Main.SelectedIndex].Controls[0];
                                    List<byte> toSave = new List<byte>();
                                    if (!saveIsPC)
                                    {
                                        toSave = new List<byte>(MainSave.WriteChecksum(loadedSave.Skip((int)(0x6004 * uc.mainIndex)).Take(0x6004).ToArray(), false, false));
                                        toSave[3] = (byte)slotNotTaken;
                                    }
                                    else
                                    {
                                        toSave.Add(0x00);
                                        toSave.Add(0x00);
                                        toSave.Add(0x00);
                                        toSave.Add((byte)slotNotTaken);
                                        toSave.AddRange(MainSave.ByteSwapMain(loadedSave));
                                        toSave = MainSave.WriteChecksum(toSave.ToArray(), false, false).ToList();
                                    }
                                    combinedSave.AddRange(save.Take(0x6004 * slotIndex));
                                    combinedSave.AddRange(toSave);
                                    combinedSave.AddRange(save.Skip(0x6004 * (slotIndex + 1)));
                                    break;
                                }
                                slotIndex++;
                            }
                            string consoleFileName = Path.GetDirectoryName(loadedFile) + @"\savedata.bin";
                            int index = 1;
                            while (true)
                            {
                                if (!File.Exists(consoleFileName))
                                {
                                    break;
                                }
                                else
                                {
                                    consoleFileName = Path.GetDirectoryName(loadedFile) + @"\savedata" + index + ".bin";
                                    index++;
                                }
                            }
                            File.WriteAllBytes(consoleFileName, combinedSave.ToArray());
                            MessageBox.Show("Save file has been saved to " + consoleFileName + ", in slot " + slotNotTaken + ".", "Success", MessageBoxButtons.OK, MessageBoxIcon.None);
                        }
                        else
                        {
                            MessageBox.Show("Couldn't find a slot to save to!", "Error writing save", MessageBoxButtons.OK, MessageBoxIcon.Error);
                        }
                    }
                    else
                    {
                        MessageBox.Show("That doesn't appear to be a console main save.", "Error writing save", MessageBoxButtons.OK, MessageBoxIcon.Error);
                    }
                }
            }
            catch
            {
                MessageBox.Show("There was a problem saving the save file!", "Error", MessageBoxButtons.OK, MessageBoxIcon.Error);
            }
        }

        private void Btn_AutoUpdate_Click(object sender, EventArgs e)
        {
            DialogResult result = MessageBox.Show("Do you want to update now?", "Auto Updater", MessageBoxButtons.YesNo);
            if (result == DialogResult.Yes)
            {
                UpdateApplication();
            }
        }

        private void UpdateApplication()
        {
            using (var client = new WebClient())
            {
                client.DownloadFile(latestVersionDownloadURL, "temp.exe");
                if (File.Exists("temp.exe"))
                {
                    Assembly currentAssembly = Assembly.GetEntryAssembly();
                    if (currentAssembly != null)
                    {
                        string currentFolder = Path.GetDirectoryName(currentAssembly.Location);
                        string currentName = Path.GetFileNameWithoutExtension(currentAssembly.Location);
                        string currentExtension = Path.GetExtension(currentAssembly.Location);
                        string tempFile = Path.Combine(currentFolder, "temp.exe");
                        string newFile = Path.Combine(currentFolder, latestVersionFile);
                        string currentFile = Path.Combine(currentFolder, currentName + currentExtension);
                        if (!Directory.Exists(oldDir)) { Directory.CreateDirectory(oldDir); }
                        string backupPath = Path.Combine(oldDir, currentName + ".old");
                        File.Move(currentFile, backupPath);
                        File.Move(tempFile, newFile);
                        Application.Restart();
                    }
                }
            }
        }

        private void Checkb_CheckForUpdates_CheckedChanged(object sender, EventArgs e)
        {
            XmlDocument xml = new XmlDocument();
            xml.Load(configFile);
            XmlNode root = xml.DocumentElement["CheckForUpdates"];
            root.FirstChild.InnerText = checkb_CheckForUpdates.Checked.ToString();
            xml.Save(configFile);
            checkForUpdates = checkb_CheckForUpdates.Checked;
            if (!checkForUpdates && autoUpdate) { checkb_AutoUpdate.Checked = false; }
            if (checkForUpdates)
            {
                Thread updateCheckThread = new Thread(new ThreadStart(UpdateCheck));
                updateCheckThread.Start();
            }
        }

        private void Checkb_AutoUpdate_CheckedChanged(object sender, EventArgs e)
        {
            XmlDocument xml = new XmlDocument();
            xml.Load(configFile);
            XmlNode root = xml.DocumentElement["AutoUpdate"];
            root.FirstChild.InnerText = checkb_AutoUpdate.Checked.ToString();
            xml.Save(configFile);
            autoUpdate = checkb_AutoUpdate.Checked;
            if (autoUpdate)
            {
                checkb_CheckForUpdates.Checked = autoUpdate;
                Thread updateCheckThread = new Thread(new ThreadStart(UpdateCheck));
                updateCheckThread.Start();
            }
        }
    }
